    "2015-09-26T19:18:10.371271",nt"name": "fish-aggregation-sites-in-the-florida-keys",nt"isopen":
    false,nt"url": null,nt"notes": "Spawning aggregations are an important
    event in the life-history of many coral reef fish species. During short time periods
    (typically during full moons), fish will aggregate to spawn at discrete locations
    along a coral reef tract. Locations of historical spawning aggregations in the Florida
    Keys Reef Tract were collected through interviews with fishermen and review of the
    scientific literature. Field assessments are conducted during predicted spawning
    times, typically during full moon periods in the winter, spring and summer.",nt"license_title":
